import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { AuthService } from './AuthService ';
import axios from 'axios';


export default function PBooking(){

    const [booking, seBooking] = useState([]);

  const getVehicle = () => {
    axios.get('http://localhost:6060/User/')
      .then((res) => {
        console.log(res.data);
        seBooking(res.data);
      })
      .catch((err) => {
        alert(err.message);
      });    
      
  };

  useEffect(() => {
    getVehicle();
    
  }, []);

  const handleLogout = () => {
    AuthService.logout(); // Call the logout method from AuthService
    window.location.href = '/'; // Redirect to the login page after logout
  };
// Correct usage of AuthService
  const isLoggedIn = AuthService.isLoggedIn();

  useEffect(() => {
    if (!isLoggedIn) {
      // Redirect to login if user is not logged in
      window.location.href = '/';
    }
  }, [isLoggedIn]);



    return(
        <div >
                
          <div class="sidebar">
            <div class="admin-info">
              <img src="http://localhost:6060/images/man.jpg" alt="Admin Logo"/>
              <p >Sathsara</p>
              <hr/>
            </div>
            <ul>
              <li><a href="/Header/:id">Home</a></li>
              <li class="dropdown">
                <a href="#" class="dropdown-toggle">Vehicles</a>
                <div class="dropdown-content">
                  <a href="/all">All Vehicles</a>
                  <a href="/add">Add Vehicle</a>
                  
                </div>
              </li>
              <li class="dropdown">
                <a href="#" class="dropdown-toggle">Users</a>
                <div class="dropdown-content">
                  <a href="/AllUser">All Users</a>
                  <a href="/AddUser">Add User</a>
                
                </div>
              </li>
              <li><a href="orders.html">Bookings</a></li>
              <li><a href="/inde">Settings</a></li>
              <li><button onClick={handleLogout}>Logout</button></li>
            </ul>
          </div>

          <div class="content1">
            
          </div>
        
    <div style={{ overflowX: 'auto',padding: '20px', marginLeft:'125px' ,alignItems:'center' }}>
    <h1 style={{ alignItems:'center', color:"#808080"}}>All Vehicles</h1>
    <div style={{ overflowX: 'auto', marginLeft: '130px', maxHeight: '500px' }}>
      <table style={{ borderCollapse: 'collapse', width: '100%', border: '1px solid #ddd', borderRadius: '5px' }}>
        <thead style={{ backgroundColor: '#f0f0f0', borderBottom: '2px solid #ddd' }}>
          <tr>
            <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Vehicle Number</th>
            <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Email</th>
            <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Pick up date</th>
            <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Return Date</th>
            <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Status</th>
            <th style={{ padding: '5px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>View</th>
            <th style={{ padding: '5px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Accept/Decline</th>
            <th style={{ padding: '5px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Update</th>

          </tr>
        </thead>
        <tbody style={{ maxHeight: '500px' }}>
          {booking.map((b, index) => (
            <tr key={index} style={{ borderBottom: '1px solid #ddd' }}>
              <td style={{ padding: '12px' }}>{b.regnumber}</td>
              <td style={{ padding: '12px' }}>{b.email}</td>
              <td style={{ padding: '12px' }}>{b.pickupdate}</td>
              <td style={{ padding: '12px' }}>{b.returndate}</td>
              <td style={{ padding: '12px' }}>{b.status}</td>
              <td style={{ padding: '5px', textAlign: 'center' }}>
                <a className="nav-link" href={`/get/${b._id}`}>
                  <img
                    src={`http://localhost:6060/images/eye.png`}
                    alt={`${index}`}
                    style={{ width: '20px', height: '20px', objectFit: 'cover', cursor: 'pointer' }}
                  />
                </a>
              </td>
              <td style={{ padding: '5px', textAlign: 'center' }}>
              <select style={{ background: 'white' }} name="Type" class="form-control"  id="txtType" >
                    <option value="Available">Decline</option>
                    <option value="Unavailable">Accept</option>
                    
                </select>
              </td>
              <td style={{ padding: '12px' }}><button type="submit">Ok</button></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  </div>
  </div>



    )
}
